import S from "./style";

const Footer = () => {
    return (
        <S.FooterWrapper>
            <S.LogoWrapper>
                <img src="/assets/img/logo-w.svg" alt="MungPick 로고" />
            </S.LogoWrapper>

            <div>

            </div>
        </S.FooterWrapper>
    );
};

export default Footer;
